import axios, { Axios } from 'axios';
import { Link, Route, Router, Routes, useNavigate,Outlet } from 'react-router-dom';
import './Authorization.css';
function Authorization(){
    // const navigate =  useNavigate();
    return(
        <div className='mainDiv'>
            <h1>Authorization</h1>
            <input id='login' type="text" placeholder="Login" />
            <input id='pass' style={{ margin: '0px' }} type="password" placeholder="Password" />
            <button onClick={() => {
                axios({
                    method: 'post',
                    url: 'https://localhost:7031/api/Authentication/Login',
                    data: {
                        "userName": document.getElementById('login').value,
                        "password": document.getElementById('pass').value
                    },
                    dataType: "dataType",
                    headers: {
                        'Accept': '*/*',
                        'Content-Type': 'application/json'
                    }
                }).then(data => {
                    sessionStorage.setItem('token', data['data']['token']);
                    return(
                        <div>
                            <nav>
                                <Link to='/authorization'>Authorization</Link>
                            </nav>
                            <Outlet />
                        </div>
                    );



                    // <Router>
                    //     <useNavigate href='/authorization' replace = 'true'></useNavigate>
                    //    {/* useNavigate('/authorization',{replace:true}); */}
                    // </Router>
                    // setTimeout(()=>{
                    //     navigate('/authorization',{replace:true},3000);
                    // });
                    // window.location.href ='http://localhost:3000/MainPage';

                });
            }}>Confirm</button>
        </div>
    );

}
export default Authorization;
